import ProductInCartCard from "../components/ProductInCartCard";

function Cart( { cart } ) {

    const removeProduct = (name) => {

        setCart(cart.filter(product => product.name !== name));
    }

    const items = cart.map(item => <ProductInCartCard key={item.id} {...item} removeProduct={removeProduct} />
    )

    return (
        <div>{items}</div>
    )

}

export default Cart;
